import React from 'react'
import NavItem from '../components/navigation/NavItem.jsx';
import Modal from '../components/modal/Modal.jsx';
import img from '../img/calendar.svg';


const Donations = ({btn_name, btn_num, setBtnNum, active, setActive }) => {
    return (
        <main>
            <div className="container">
                <div className="btn_window_container">
                </div>
                <NavItem btn_name={btn_name} btnNum={btn_num} setBtnNum={setBtnNum} active={active} setActive={setActive} nav_num={2} nav_img={img} />

            </div>
            <Modal num={btn_num} active={active} setActive={setActive} />
        </main>
    )
}

export default Donations;
